import React,{useState} from "react";
import { Route ,useNavigate ,} from "react-router-dom";

import {
  TextField,
  Grid,
  Paper,
  Avatar,
  Button,
  FormControlLabel,
  Checkbox,
  Typography,
} from "@mui/material";
import LockIcon from "@mui/icons-material/Lock";
import { Link } from "react-router-dom";

export function Home() {
  const navigate = useNavigate();
  let [email, setEmail] = useState("")
  let [password ,setPassword] = useState("")
  const paperStyle = {
    padding: 20,
    height: "65vh",
    align: "center",
    width: 500,
    margin: "20px auto",
  };

  const handelSubmit = async (e)=>{
    e.preventDefault();
    let obj = { email: email, password: password }
    let result = await fetch("http://localhost:5000/api/accounts/login", {
      method: "POST",
      headers: { Accept: 'application/json', 'Content-Type': 'application/json' },
      body: JSON.stringify(obj)
    })

    result = await result.json()
    if (result.status) navigate('/signup')
    console.log(result)

  }


  const avatarStyle = { backgroundColor: "#1bbd7e" };
  return (
    <div>
      <div>
        <Grid>
          <Paper elevation={10} style={paperStyle}>
            <Grid align="center">
              <Avatar style={avatarStyle}>
                <LockIcon />
              </Avatar>
            </Grid>
            <br />
            <h1 style={{"text-align": "center" }}>LogIn</h1>
            <div style={{ padding: "30px" }}>
              <br />
              <TextField variant="outlined" label="Email" type="email" value={email}  fullWidth onChange={(e)=>{setEmail(e.target.value)}} />
              <br />
              <br />
              <TextField variant="filled" label="Password" type="password"  fullWidth value={password} onChange={(e)=>{setPassword(e.target.value)}}/>
            </div>
            <FormControlLabel
              control={<Checkbox name="checkedB" color="primary" />}
              label="Remember me"
            />
            <Button type="submit" color="primary" variant="contained" fullWidth onClick={handelSubmit}>
              Sign in
            </Button>
            <br />
            <Typography>
              <Link href="#">Forget password ?</Link>
            </Typography>
            <br />
            <Typography>
              <Link href="#" >Sign Up</Link>
              <NavLink activeClassName="is-active" to="/">
              Home
            </NavLink>
            </Typography>
          </Paper>
        </Grid>
      </div>
    </div>
  );
}
